import './App.css';
import React, { useEffect, useRef, useState } from 'react';
import gsap from 'gsap';

import logo from './img/logo.png';
import hero1 from './img/hero_1.jpg';
import hero2 from './img/hero_2.jpg';
import hero3 from './img/hero_3.jpg';
import hero4 from './img/hero_4.jpg';
import hero5 from './img/hero_5.jpg';

function App() {
  const [currentIndex, setCurrentIndex] = useState(0);
  const imgRef = useRef(null);

 useEffect(()=>{
  let tl = gsap.timeline();
  tl.fromTo(".logo",{
    y:-80,
  opacity:0,
  },
  {
    y:0,
    duration:1,
    opacity:1
  })
  tl.fromTo("li",{
    y:-40,
    opacity:0
  },
  {
    y:0,
    duration:1,
    opacity:1,
    delay:-0.5,
    stagger:0.1
  }
  )
 })

  const images = [hero1, hero2, hero3, hero4, hero5];
  const texts = [
      "Farming is the best solution of world's starvation",
      "Our Services are Top Notch",
      "Join Us for Great Experiences",
      "Customer Satisfaction Guaranteed",
      "Contact Us for More Information"
    ];

   let imgLen = images.length;
  const slideLeft = () => {
    let newIndex1 = currentIndex===0?imgLen-1: currentIndex - 1;
    setCurrentIndex(newIndex1);
    let valueP = -newIndex1*window.innerWidth;  
    gsap.to(imgRef.current, {
    x: valueP,
    duration: 1,
    delay: 0.1
    });
  }

  // Slide right (move to the left direction)
  const slideRight = () => {
   let newIndex2 =  currentIndex === imgLen-1 ? 0: currentIndex+1;
   setCurrentIndex(newIndex2);

  let valuePP = -newIndex2*window.innerWidth;
    gsap.to(imgRef.current, {
      x: valuePP,
      duration: 1,
      delay: 0.1,
    });
  }
  let img1 = {
    position:'absolute',
  left:`${20*window.innerWidth}%`,
  top:'35%',
  zIndex:'23',
  }

  return (
    <>
      <div className="container">
        <nav>
          <div className="logo">
            <img src={logo} alt="Logo" />
          </div>
          <ul>
            <li className='li'>Home</li>
            <li className='li'>About Us</li>
            <li className='li'>Our Services</li>
            <li className='li'>Testimonials</li>
            <li className='li'>Blogs</li>
            <li className='li'>Dropdown <span></span></li>
            <li className='li'>Contact</li>
          </ul>
        </nav>

        <div className="img-slider">
          <svg onClick={slideLeft} width="36" height="36" fill="currentColor" className="bi bi-arrow-left-short" viewBox="0 0 16 16">
  <path fill-rule="evenodd" d="M12 8a.5.5 0 0 1-.5.5H5.707l2.147 2.146a.5.5 0 0 1-.708.708l-3-3a.5.5 0 0 1 0-.708l3-3a.5.5 0 1 1 .708.708L5.707 7.5H11.5a.5.5 0 0 1 .5.5"/>
</svg>
<svg onClick={slideRight} width="36" height="36" fill="currentColor" className="bi bi-arrow-right-short" viewBox="0 0 16 16">
  <path fill-rule="evenodd" d="M4 8a.5.5 0 0 1 .5-.5h5.793L8.146 5.354a.5.5 0 1 1 .708-.708l3 3a.5.5 0 0 1 0 .708l-3 3a.5.5 0 0 1-.708-.708L10.293 8.5H4.5A.5.5 0 0 1 4 8"/>
</svg>   
          {/* Image display */}
          <div className="imgCollection" ref={imgRef} style={{ display: 'flex' }}>  
            {images.map((img, index) => (

              <div className="overImg" key={index}>
              <img key={index} src={img} alt="Slide" style={{ width: '100vw', flexShrink: 0 }} />


          <h1 style={{position:'absolute',left:'20%',top:'35%',zIndex:'23',transform:'translateX(20%,0)'}}>{texts[0]}</h1>
          <h1 style={img1}>{texts[1]}</h1>
          </div>
     ))}
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
